export default (function(a,b,c,d,e,f,g,h,i){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:d,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:d,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}},{id:2784,attributes:{type:b,item_lang:{data:{id:3451,attributes:{title:"Renfield",slug:"renfield"}}}}},{id:2788,attributes:{type:b,item_lang:{data:{id:3455,attributes:{title:"The Killer",slug:"the-killer"}}}}},{id:2790,attributes:{type:b,item_lang:{data:{id:3457,attributes:{title:"The Color Purple",slug:"the-color-purple"}}}}},{id:2798,attributes:{type:d,item_lang:{data:{id:3465,attributes:{title:"Silo",slug:"silo"}}}}},{id:2802,attributes:{type:d,item_lang:{data:{id:3469,attributes:{title:"The Night Agent",slug:"the-night-agent"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:10}}},IIzcNgJXqY:{data:{id:94,attributes:{imdbId:"tt0065377",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BOTk5NWJkYjItMjA2MC00NThiLWE4NTctOTFlYjcwOTA1YTM1XkEyXkFqcGdeQXVyMTA0MjU0Ng@@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"6.6\u002F10"},{Source:"Rotten Tomatoes",Value:"73%"},{Source:"Metacritic",Value:"42\u002F100"}],item_lang:{data:{id:757,attributes:{title:e,plot:"This precursor to later \"epic\" 1970s disaster films presents 12 hours in the lives of the personnel and passengers at the \"Lincoln Airport.\" Endless problems, professional and personal, are thrown at the various personnel responsible for the safe and proper administration of air traffic, airline management, and aviation at a major US airport. Take one severe snowstorm, add multiple schedules gone awry; one elderly Trans Global Airlines stowaway; shortages; an aging, meretricious pilot; unreasonable, peevish spouses; manpower issues, fuel problems, frozen runways; and equipment malfunctions, and you get just a sample of the obstacles faced by weary, disgruntled personnel and passengers at the Lincoln Airport. Toss in one long-suffering pilot's wife, several stubborn men, office politics and romance, and one passenger with a bomb, and you have the film \"Airport\" from 1970.",slug:"airport"}}},books:{data:[{id:437,attributes:{title:e,description:"The #1 New York Times–bestselling thriller about an airport thrust into chaos by a whiteout blizzard: “A spellbinder” (The Denver Post). As a raging blizzard wreaks havoc at Lincoln International Airport outside Chicago, airport and airline personnel try to cope with this unstoppable force of nature that is endangering thousands of lives. And in the air, a lone plane struggles to reach its destination. Over the course of seven pulse-pounding hours, a tense human drama plays out as a brilliant airport manager, an arrogant pilot, a tough maintenance man, and a beautiful stewardess strive to avert disaster. Featuring a diverse cast of vibrant characters, Airport is both a realistic depiction of the airline industry and a novel of nail-biting suspense. This ebook includes a foreword by the author.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ZBZoAwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:true,published:h,publisher:i,subtitle:a}},{id:438,attributes:{title:e,description:"Part of a series designed to be suitable for students at upper intermediate level, including those preparing for the Cambridge First Certificate examinations. All titles feature an introduction to the authors, the characters and themes of the text.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=WElapd7prQsC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:f,published:"1993-01-01",publisher:"Longman Publishing Group",subtitle:a}},{id:439,attributes:{title:"Airport ; Hotel ; Wheels",description:a,thumbnail:a,authors:[c],firstBook:f,published:"1994-01-01",publisher:"Bounty Books",subtitle:a}},{id:440,attributes:{title:"Hotel",description:"The #1 New York Times–bestselling author of Airport reveals the inner workings of a New Orleans hotel—and the human drama unfolding behind its closed doors. During five sultry days, the lives of the guests, the management, and the workers at New Orleans’ largest and most elite hotel converge. The owner has four days to raise the money to save his financially ailing property. The general manager, once blacklisted from the hospitality business, struggles with one crisis after another. A rebellious heiress will do anything to attain her secret desires. The duke and the duchess in the lavish presidential suite are covering up a crime. And within one of the many guest rooms hides a professional thief. Filled with memorable characters and authentic detail about the inner machinery and secrets of a five-star hotel, this gripping New York Times bestseller sold millions of copies and was adapted for both film and TV. Set in a time when travel was still glamorous and grand independent hotels set the standard for luxury, it’s a read like a vacation in itself, from the author of such behind-the-scenes blockbusters as The Moneychangers and Wheels.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=rhZoAwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:f,published:h,publisher:i,subtitle:a}},{id:441,attributes:{title:e,description:"Over de gebeurtenissen die zich afspelen rond een vliegveld, waar door de slechte weersomstandigheden enorme vertragingen zijn ontstaan.",thumbnail:a,authors:[c,"Rosalie Kerr"],firstBook:f,published:"1977-01-01",publisher:"London : Longman",subtitle:a}}]}}},meta:{}}},prerenderedAt:1694069423341}}("","movie","Arthur Hailey","series","Airport",null,1,"2014-05-13","Open Road Media"))